import React from "react";

function App() {
  const projects = [
    { name: "places2be", description: "Description of project 1", link: "https://www.youtube.com/watch?v=xZwKXef8rUE" },
    { name: "Farmers Retreat Website", description: "Description of project 2", link: "#" },
    { name: "Project 3", description: "Description of project 3", link: "#" },
  ];

  return (
    <div style={{ fontFamily: "Arial, sans-serif", margin: "20px" }}>
      <header style={{ textAlign: "center", marginBottom: "40px" }}>
        <h1>Chase C. Vitale</h1>
        <p>Welcome to my portfolio!</p>
      </header>
      <main>
        <h2>About me:</h2>
          <text>I am a sophomore at NYU studying Math and Computer Science"</text>
          <text></text>
        <h2>My Projects:</h2>
        <ul style={{ listStyleType: "none", padding: 0 }}>
          {projects.map((project, index) => (
            <li
              key={index}
              style={{
                marginBottom: "20px",
                padding: "10px",
                border: "1px solid #ccc",
                borderRadius: "8px",
              }}
            >
              <h3>{project.name}</h3>
              <p>{project.description}</p>
              <a
                href={project.link}
                target="_blank"
                rel="noopener noreferrer"
                style={{ color: "blue", textDecoration: "none" }}
              >
                View Project
              </a>
            </li>
          ))}
        </ul>
      </main>
    </div>
  );
}

export default App;
